DROP SINK IF EXISTS types_flink_sink;
DROP TABLE IF EXISTS kafka_flink_types;
CREATE TABLE IF NOT EXISTS kafka_flink_types(
id int,
c_boolean boolean,
c_smallint smallint,
c_integer integer,
c_bigint bigint,
c_decimal decimal,
c_real real,
c_double_precision double precision,
c_varchar varchar,
c_bytea bytea,
);

CREATE SINK IF NOT EXISTS types_flink_sink
FROM kafka_flink_types
WITH (
connector = 'kafka',
properties.bootstrap.server='message_queue:29092',
topic = 'flinktypes',
primary_key = 'id'
) FORMAT DEBEZIUM ENCODE JSON;

